B.Xs=new A.fF("\u6d41 (Streams)","\u5904\u7406\u5f02\u6b65\u4e8b\u4ef6\u5e8f\u5217","Stream \u662f\u4e00\u7cfb\u5217\u5f02\u6b65\u4e8b\u4ef6\u7684\u5e8f\u5217\uff08\u7c7b\u4f3c\u7ba1\u9053\uff09\u3002\n- **Single subscription**: \u53ea\u80fd\u88ab\u76d1\u542c\u4e00\u6b21\uff08\u5982\u6587\u4ef6\u8bfb\u53d6\uff09\u3002\n- **Broadcast**: \u53ef\u4ee5\u88ab\u591a\u4e2a\u76d1\u542c\u8005\u76d1\u542c\uff08\u5982\u9f20\u6807\u4e8b\u4ef6\uff09\u3002\n- **async***: \u751f\u6210\u5668\u51fd\u6570\uff0c\u4f7f\u7528 `yield` \u53d1\u9001\u6570\u636e\u5230 Stream\u3002","Stream<int> countSeconds(int max) async* {\n  for (int i = 1; i <= max; i++) {\n    await Future.delayed(const Duration(seconds: 1));\n    yield i;\n  }\n}\n\nvoid main() async {\n  // \u76d1\u542c\u6d41\n  await for (final tick in countSeconds(3)) {\n    print('$tick seconds passed');\n  }\n}\n","WebSocket \u8fde\u63a5\u3001\u5b9a\u65f6\u5668\u3001\u7528\u6237\u8f93\u5165\u4e8b\u4ef6\u6d41\u3002Flutter \u4e2d\u7684 `StreamBuilder` Widget \u4e13\u95e8\u7528\u4e8e\u6839\u636e Stream \u7684\u6700\u65b0\u6570\u636e\u91cd\u5efa UI\u3002",!1)
B.Xt=new A.fF("\u63a7\u5236\u6d41 (Control Flow)","if, for, while, switch \u4ee5\u53ca\u96c6\u5408\u4e2d\u7684\u63a7\u5236\u6d41","\u6807\u51c6\u7684\u63a7\u5236\u6d41\u8bed\u53e5\uff1a\n- **if-else**: \u6761\u4ef6\u5224\u65ad\u3002\n- **for / for-in**: \u5faa\u73af\u3002\n- **while / do-while**: \u5faa\u73af\u3002\n- **switch**: \u591a\u6761\u4ef6\u5206\u652f\u3002\n\nDart \u7279\u6709\u7684 **Collection if** \u548c **Collection for** \u53ef\u4ee5\u5728\u6784\u5efa List/Map \u65f6\u76f4\u63a5\u4f7f\u7528\u6761\u4ef6\u548c\u5faa\u73af\uff0c\u975e\u5e38\u9002\u5408\u6784\u5efa UI\u3002","void main() {\n  // Standard loop\n  for (var i = 0; i < 3; i++) {\n    print(i);\n  }\n\n  // Collection if\n  bool isAdmin = true;\n  List<String> menu = [\n    'Home',\n    'Profile',\n    if (isAdmin) 'Admin Panel', // \u53ea\u6709 isAdmin \u4e3a true \u65f6\u624d\u6dfb\u52a0\n  ];\n\n  // Collection for\n  List<int> source = [1, 2, 3];\n  List<String> formatted = [\n    'Header',\n    for (var i in source) 'Item #$i',\n  ];\n}\n","\u5728 Flutter \u7684 build \u65b9\u6cd5\u4e2d\uff0c`Collection if` \u548c `Collection for` \u975e\u5e38\u5f3a\u5927\uff0c\u7528\u4e8e\u6839\u636e\u72b6\u6001\u52a8\u6001\u6784\u5efa Widget \u5217\u8868\u3002",!0)
B.Xu=new A.fF("\u51fd\u6570 (Functions)","\u53c2\u6570\u4f20\u9012\u3001\u547d\u540d\u53c2\u6570\u3001\u53ef\u9009\u53c2\u6570\u53ca\u7bad\u5934\u51fd\u6570","Dart \u51fd\u6570\u662f\u4e00\u7b49\u516c\u6c11\u3002\n- **\u4f4d\u7f6e\u53c2\u6570**: \u5fc5\u987b\u6309\u987a\u5e8f\u4f20\u9012\u3002\n- **\u547d\u540d\u53c2\u6570**: \u4f7f\u7528 `{}` \u5305\u88f9\uff0c\u8c03\u7528\u65f6\u9700\u6307\u5b9a\u540d\u79f0\uff0c\u53ef\u8bfb\u6027\u9ad8\uff0c\u901a\u5e38\u914d\u5408 `required` \u4f7f\u7528\u3002\n- **\u53ef\u9009\u4f4d\u7f6e\u53c2\u6570**: \u4f7f\u7528 `[]` \u5305\u88f9\u3002\n- **\u7bad\u5934\u51fd\u6570**: `=>` \u8bed\u6cd5\u7528\u4e8e\u53ea\u6709\u4e00\u884c\u8868\u8fbe\u5f0f\u7684\u51fd\u6570\u3002","// \u547d\u540d\u53c2\u6570\nvoid greet({required String name, String? message}) {\n  print('$name: ${message ?? \"Hello\"}');\n}\n\n// \u53ef\u9009\u4f4d\u7f6e\u53c2\u6570\nString join(String a, [String b = '']) {\n  return a + b;\n}\n\n// \u7bad\u5934\u51fd\u6570\nint add(int a, int b) => a + b;\n\nvoid main() {\n  greet(name: 'Alice', message: 'Hi');\n  greet(name: 'Bob');\n  \n  print(join('A', 'B'));\n  print(add(5, 3));\n}\n","Flutter Widget \u7684\u6784\u9020\u51fd\u6570\u5927\u91cf\u4f7f\u7528\u547d\u540d\u53c2\u6570\uff0c\u4ee5\u63d0\u9ad8\u4ee3\u7801\u53ef\u8bfb\u6027\u3002\u7b80\u5355\u7684 getter \u6216\u56de\u8c03\u51fd\u6570\u5e38\u4f7f\u7528\u7bad\u5934\u51fd\u6570\u3002",!0)
